import React from 'react'
import { Spring, animated } from 'react-spring/renderprops'
import * as easings from 'd3-ease'

export default class AnimatedCameraOnSVG extends React.PureComponent {
  state = { offset: 0 }

  path = React.createRef()

  componentDidMount() {
    this.setState({
      offset: this.path.current.getTotalLength()
    })
  }

  render() {
    const { offset } = this.state

    return (
      <div
        style={{
          width: '100%',
          height: '100%',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center'
        }}
      >
        <svg width='24' height='16' viewBox='0 0 24 16' fill='none' xmlns='http://www.w3.org/2000/svg'>
          <g clipPath='url(#clip0)' stroke='#fff' strokeWidth='1'>
            <Spring
              native
              reset
              from={{ dash: offset }}
              to={{ dash: 0 }}
              config={{ delay: 100, duration: 700, easing: easings.easeCubic }}
            >
              {props => (
                <animated.path
                  ref={this.path}
                  fill='none'
                  stroke='#fff'
                  strokeDashoffset={props.dash}
                  strokeDasharray={offset}
                  strokeMiterlimit={10}
                  d='M15.2547 0.527359H2.56223C1.42033 0.527359 0.494629 1.51428 0.494629 2.73171V13.2683C0.494629 14.4857 1.42033 15.4726 2.56223 15.4726H15.2547C16.3966 15.4726 17.3223 14.4857 17.3223 13.2683V2.73171C17.3223 1.51428 16.3966 0.527359 15.2547 0.527359Z M23.4954 2.84773V13.7324L17.3223 8.96507V7.52011L23.4954 2.84773Z'
                  strokeLinecap='round'
                  strokeLinejoin='round'
                />
              )}
            </Spring>
            <defs>
              <clipPath id='clip0'>
                <path d='M0 0H24V16H0V0Z' fill='white' />
              </clipPath>
            </defs>
          </g>
        </svg>
      </div>
    )
  }
}
